import React from 'react';
import history from './history'
import './Prepare.css';
import './Item'
import Item from './Item';
export default class Prepare extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return <div id="prepare-screen">
        <button on onClick={()=>{history.push("/");history.go();}}>GO to Home</button>
      <div id="grid">
      <div id="select-army">
        <Item image={require("./assets/Soldiers/Soldier1.png")} />
      </div>
      <div id="select-terrain"></div>
      <div id="info-army"></div>
      <div id="enemy-army"></div>
      </div>
      </div>
  }
}
